import React from 'react'
import './YoutubeAudio.css'

class YoutubeAudio extends React.Component {
    render(){
        return(
               <div className="container-fluid" id="yt" style={{padding:'10px'}}>

                   <div className="row">
                        <div className="col-sm-10"><input placeholder="Search audiobooks" style={{
                            border:'1px solid black',
                            backgroundColor:'black',
                            padding:'5px',
                            width:'100%',
                            borderRadius:'5px',
                            paddingLeft:'10px',
                            color:'white'}}></input>
                        </div>
                   <div className="col-sm-2">
                       <button>Search</button>
                   </div>
                   </div>
               </div>

        )
    }

}
export default YoutubeAudio;
